import styled from 'styled-components';

export const MainLayout = styled.div`
  width: 100%;
  height: 450px;
  background-color: #cbe9ff;
  border: 1px solid #000;
`;

export const MainTitle = styled.h1`
  font-size: 2rem;
  font-weight: 700;
`;
